description:
Ugh! Lifes been miserable ever since that one stupid kiss! I NEVER should've done that! 'You wanna try?' she askedIts all her fault, and now shes ignoring me! I cant stop thinking about her!!!" Poor, unfortunate Ji-Won, stuck in a hormonal, teen game of cat and mouse. Kissed by her best friend, shes left to her own devices to figure out what the hell is going on. Watch as cat turns to mouse, mouse to cat, and see how two childhood friends tiptoe the boundaries of their relationship.

